window.bookSummaryJSON = "<p>When bounty hunter Liam Quinn discovered that Claire Connolly was a Sensitive and infected with magic, he should have turned her in to be locked up in the prison district known as Devil's Isle. Instead, he helped her learn to control her power and introduced her to an underground group of paranormals and humans who know the truth about the war and those who fought it. </p> <p>Now, the weight of Liam's own secrets has forced him into hiding. When a government agent is killed and Claire discovers that Liam is the prime suspect, she races to find him before the government can. But she'll discover proving his innocence is no simple matter. Their enemies are drawing closer, and time is running out.... </p>"; 
